DROP TABLE IF EXISTS `reviews`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `reviews` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор отзыва',
  `user_id` int unsigned DEFAULT NULL COMMENT 'Идентификатор пользователя',
  `product_id` bigint unsigned DEFAULT NULL COMMENT 'Идентификатор товара',
  `body` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тело отзыва',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания отзыва',
  PRIMARY KEY (`id`),
  KEY `reviews_fk_user_id` (`user_id`),
  KEY `reviews_fk_product_id` (`product_id`),
  CONSTRAINT `reviews_fk_product_id` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE SET NULL,
  CONSTRAINT `reviews_fk_user_id` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Отзывы';
/*!40101 SET character_set_client = @saved_cs_client */;

